import React from "react";
export default class Model extends React.Component{
    constructor(props) {
        super(props);
        console.log(props);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleSubmit(e){
        e.preventDefault();
        fetch('http://localhost:8000/api/home',{
            method: 'DELETE',
            body: JSON.stringify({
                "_id":this.props.model._id
            })
        }).then( async (response) => {
            let res = response;
            console.log(res);
        });
        const request = 'http://localhost:8000/api/home?_id='+ this.props.model._id;
        fetch(request).then(async response=>{
            const res = await response.json();
            console.log(res);
        })
    }
    render() {
        return (
            <div class="card">
                <form onSubmit={this.handleSubmit}>
                    <ul class="list-group list-group-flush">
                        {this.props.model.state && <li class="list-group-item"><label>State:{this.props.model.state}</label></li>}
                        {this.props.model.date && <li class="list-group-item"><label>Date:{this.props.model.date}</label></li>}
                        {this.props.model.cases && <li class="list-group-item"><label>Cases:{this.props.model.cases}</label></li>}
                        {this.props.model.deaths && <li class="list-group-item"><label>Deaths:{this.props.model.deaths}</label></li>}
                    </ul>
                    <button className = "btn btn-danger">Delete</button>
                </form>
            </div>
        )
    }
}
